import React from 'react';
import logo from './images/ClimberCrewLogo.png';
import bg from './images/backgroundimage.png';
import './App.css';

function App() {
  return (
    <div className="App">
hello
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />



        <h3>a game by Rob Quinn</h3>

        <h3>Climber Crew is a ragdoll physics rock climbing game</h3>

        <h2>Coming summer 2020</h2>
        <h3>Expected release on iPad, iPhone, PC, Switch, and more...</h3>


        <p>Copyright &copy; 2015-2019 Robert Quinn</p>
      </header>
    </div>
  );
}

export default App;
